import logo from "./logo.svg";
import "./App.css";
import AddData from "./component/AddData/AddData";
import "bootstrap/dist/css/bootstrap.min.css";
import ListData from "./component/ListData/ListData";

function App() {
  return (
    <div className="App">
      <div className="container mt-5">
        <AddData />
        <ListData />
      </div>
    </div>
  );
}

export default App;
